import { HalfMoon, Container } from "./styles";
import logo from "../../assets/logo-dynamox.png"
import grafismo from "../../assets/grafismo.png"
const Header = () => {
  return (
    <>
    <Container>
      <div className="left">
        <a href="https://dynamox.net/"><img src={logo}/></a>
      </div>


      <div className="right">
        <a href="https://dynamox.net/dynapredict/"><h3>DynaPredict</h3></a>
        <a href="https://dynamox.net/"><h3>Sensores</h3></a>
        <a href="https://dynamox.net/"><h3>Contato</h3></a>
      </div>
    </Container>
      <img src={grafismo}></img>
    </>
  );
};

export default Header;
